import React, { Component } from "react";
import Link from "next/link";
import Router from "next/router";

class Indexpage extends Component {
  render() {
    return (
      <div>
        <h1>Main Page</h1>
        <p>
          Go to
          <Link href="/auth">
            <a> Auth Page</a>
          </Link>
        </p>
        <button onClick={() => Router.push("/auth")}>Got to Auth</button>
      </div>
    );
  }
}

export default indexpage;
